import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from '../components/AppLayout';
import LolPostCard from '../components/LolPostCard';

const Info = () => {
    const { userId } = useSelector((state) => state.user)
    return (
        <>
        {userId && <AppLayout>
            <div>내 정보</div>
        </AppLayout>}
        </>
    );

};


export default Info;
